import axios from 'axios';

export const getCards = async (currentUser) => {
  const url = 'http://localhost:3000/dashboard';
  console.log(currentUser);
  return await axios.get(url, currentUser, { withCredentials: true }
    ).then(function (response) {
      return response;
    })
    .catch(function (error) {
      console.log(error);
    });
}
